package it.polito.dp2.TAMELESS.ass;

public class NotAcceptableNameException extends Exception {

	public NotAcceptableNameException() {
		// TODO Auto-generated constructor stub
	}

	public NotAcceptableNameException(String message) {
		super(message);
	}

	public NotAcceptableNameException(Throwable cause) {
		super(cause);
	}

	public NotAcceptableNameException(String message, Throwable cause) {
		super(message, cause);
	}

	public NotAcceptableNameException(String message, Throwable cause, boolean enableSuppression,
			boolean writableStackTrace) {
		super(message, cause, enableSuppression, writableStackTrace);
	}

}
